from .models import Product, ProductImages
from django.conf import settings
def InsertProductToDB():
  import os
  from django.conf import settings
  from django.core.files.storage import default_storage
  from django.core.files.base import ContentFile

  for profile in ProductImages.objects.all():
      old_path = profile.image_url.path
      if not os.path.exists(old_path):
          print(f"File does not exist: {old_path}")
          continue

      # New file name: profiles/ID_originalfilename.jpg
      original_filename = os.path.basename(old_path)
      new_filename = f"products/{original_filename.replace('(DRDOOM)', '_')}"
      new_path = os.path.join(settings.MEDIA_ROOT, new_filename)

      # Skip if already renamed
      if os.path.exists(new_path):
          print(f"Already renamed: {new_filename}")
          continue

      # Move file
      os.rename(old_path, new_path)

      # Update model field
      profile.image_url.name = new_filename
      profile.save()

      print(f"Renamed and updated: {old_path} -> {new_filename}")






