["""Herbsconnect(DRDOOM)Organic(DRDOOM)Gotu(DRDOOM)Kola(DRDOOM)Powder-(DRDOOM)100g""", " Health & Beauty", "Health Care", "Herbsconnect", """Pegged as the “herb of longevity,” gotu kola is a staple in traditional Chinese, Indonesian, and Ayurvedic medicine. Practitioners claim the medicinal plant has the power to boost brainpower, heal skin issues, and promote liver and kidney health Gotu kola powder may help to improve memory, support weakened veins, reduce anxiety levels, and facilitate the healing of wounds. Revered in traditional Ayurvedic and Chinese medicine, the substance has long been used to promote relaxation and meditation. Ground from the dried herb Centella asiatica, this powder can easily be mixed with drinks or food to offer a wide array of health benefits.Gotu kola is used for burns, poor circulation that can lead to varicose veins (venous insufficiency), scars, stretch marks, and many other condition.Gotu kola contains certain chemicals that seem to decrease inflammation and also decrease blood pressure in veins. Gotu kola also seems to increase collagen production, which is important for wound healing. Herbalists have long used gotu kola poultices and ointments to aid in wound healing. The current body of evidence suggests that a type of triterpene, known as asiaticosideHerbalists have long used gotu kola poultices and ointments to aid in wound healing. The current body of evidence suggests that a type of triterpene, known as asiaticoside, is able to stimulate collagen production and promote the development of new blood vessels (angiogenesis) at the injury site.  gotu kola can treat diseases from leprosy to cancer are largely exaggerated. These "cure-all" claims often shroud the actual benefits gotu kola may have in reducing disease riskClaims that gotu kola can treat diseases from leprosy to cancer are largely exaggerated. These "cure-all" claims often shroud the actual benefits gotu kola may have in reducing disease risk.Gotu kola is known to have potent antioxidanteffects, neutralizing many of the free radicalsthat cause cell damage at the molecular level.2﻿ It has been theorized that these properties may provide protection against stomach ulcers and certain cancers.Asiatic acid, found in gotu kola, has been shown in ongoing research to induce apoptosis (spontaneous cell death) and inhibit cell growth activity in certain types of cancer cells, including liver, breast, skin, brain, and gastrointestinal tumor cells is able to stimulate collagen production and promote the development of new blood vessels (angiogenesis) at the injury site. Gotu kola is also a good source of dietary fiber, providing 8 percent of the RDI for women and 5 percent of the RDI for menGotu kola contains many nutrients, which may contribute to its medicinal properties, including several B-vitamins, vitamin C and a handful of phytonutrients such as flavonoids, tannins and polyphenols. (1)These phytonutrients supply it with antioxidants — beneficial compounds that prevent damage to your cells and help ward off disease.However, the nutritional profile of gotu kola can vary significantly based on many factors, such as the way it’s processed or prepared.""", "SKU: HE628DB12M31VNAFAMZ"], 
